import Styled, { styled } from 'styled-components'

function Register() {

  const handleSubmit = (e)=>{
    e.preventDefault();
    alert('')
  }

  return (
    <>
    <FormContainer>
      <form onSubmit={(e)=>hamdleSubmit(e)}>

      </form>
    </FormContainer>
    </>
  )
}


const FormContainer = styled.div``;

export default Register
